require("spec_helper.js");

  // taking a substring of this executes much more quickly than building
  //   a test string up, even once
var aReallyLongString = "";

Screw.Unit(function(){
  before(function() { IFrame("http://localhost:3001/nodes/new"); });

  var submitId = "node_submit";
  var inputIds    = [ "node_title", "node_name", "node_description", submitId ];
  var maxLength   = [     255,           80,            65535 ];
  var flagTextIds = [ "title_too_long", "name_too_long",
                      "description_too_long" ];
  var flagIconIds = [ "title_error_icon", "name_error_icon",
                      "description_error_icon" ];

  describe( "Dynamic required input field checks in nodes/new page", function(){
    describe( "Check length of input string data", function(){
      it( "Flags exactly those input fields whose content is too long",
          function(){
        // "too long" testing doesn't apply to the "Type" selector, so set
        // it to a good value before testing, so it doesn't prevent "activation"
        // of the "Create" button at the end of the form.
        E('node_sti_type').value = "ClassNode";

        // check all (8) possible combinations input field OK or too-long
        for (var c=0; c < 8; c++){

          // set test state
          for (var cn=0, mask=1; cn < flagTextIds.length; cn++, mask*=2){

            var err = (c & mask) == 0;
            var len = maxLength[cn];
            if (err) len++;

            elem = E(inputIds[cn]);
            elem.focus();
            elem.value = aReallyLongString.substring(0, len);
            elem.blur();
          }

          // verify that unrelated error flags aren't set
          expect(E('sti_type_required').className).
            to_not(match, /helpTextFlagged/);
          expect(E('title_required').className).
            to_not(match, /helpTextFlagged/);
          expect(E('name_required').className).to_not(match, /helpTextFlagged/);
          expect(E('description_recommended').className).
            to_not(match, /helpTextFlagged/);
          expect(E('sti_type_error_icon').src).
            to(match, /blank_error_icon\.png/);

          // verify flagged/unflagged state of text input controls
          for (var cn=0, mask=1; cn < flagTextIds.length; cn++, mask*=2){

            if ((c & mask) == 0){            // error
              expect(E(flagTextIds[cn]).className).to(match, /helpTextFlagged/);
              expect(E(flagIconIds[cn]).src).to(match, /error_error_icon\.png/);
            }
            else {                           // no error
              expect(E(flagTextIds[cn]).className).
                to_not(match, /helpTextFlagged/);
              expect(E(flagIconIds[cn]).src).to(match, /blank_error_icon\.png/);
            }
          }

	  var submit = E(submitId);
          if (c == 7)
            expect(submit.className).to(match, /^activeButton$/);
          else
            expect(submit.className).to(match, /^inactiveButton$/);
        }
      });

      it( "Changes error to warning when too-long Description cleared",
          function(){
        var submit = E(submitId);

        // initialize all the non-Description elements to non-error content
        E('node_sti_type').value = "ItemNode";
        E('node_title').value = "A node for an individual thing";
        var name = E('node_name');
        name.focus();
        name.value = "indivThing";
        name.blur();

        // at this point, the "Create" button should be active
        expect(submit.className).to(match, /^activeButton$/);

        // make Description too long
        var descIndex = 2;
        var desc = E('node_description');
        desc.focus();
        desc.value = aReallyLongString.substring(0, maxLength[descIndex]+1);
        desc.blur();
        expect(E(flagTextIds[descIndex]).className).
          to(match, /helpTextFlagged/);
        expect(E(flagIconIds[descIndex]).src).to(match,
          /error_error_icon\.png/);
        expect(submit.className).to(match, /^inactiveButton$/);

        // now empty Description, ought to change it to "warning"
        desc.focus();
        desc.value = "";
        desc.blur();
        expect(E(flagTextIds[descIndex]).className).
          to_not(match, /helpTextFlagged/);
        expect(E('description_recommended').className).
          to(match, /helpTextFlagged/);
        expect(E(flagIconIds[descIndex]).src).to(match, /warn_error_icon\.png/);
        expect(submit.className).to(match, /^activeButton$/);
      });
    });
  });
});
